	unsigned long long LED_80_64::byte2ulong(unsigned char b[], int offSet)
	{
		unsigned long long x = 0;
		for (int i = 7; i >= 0; i--)
		{
			x = (x << 8) ^ b[i + offSet];
		}

		return x;
	}

	unsigned char* LED_80_64::ulong2byte(unsigned long long x)
	{
		unsigned char *b = new unsigned char[8];
		for (int i = 0; i < 8; i++)
		{
			b[i] = static_cast<unsigned char>((x >> i * 8) & 0xFF);
		}
		return b;
	}

	void LED_80_64::ulong2byte(unsigned long long x, unsigned char b[], int offSet)
	{
		for (int i = 0; i < 8; i++)
		{
			b[offSet + i] = static_cast<unsigned char>((x >> i * 8) & 0xFF);
		}
	}

	unsigned long long LED_80_64::AddKey(unsigned long long state, unsigned long long roundKey)
	{
		return state ^ roundKey;
	}

	unsigned long long LED_80_64::AddConstants(unsigned long long state, int round)
	{
		return state ^ RCandKeySizeConstLong[round];
	}

	unsigned long long LED_80_64::SubCellShiftRowAndMixColumns(unsigned long long state)
	{
		unsigned long long temp = 0;

		temp = T0[state >> 0 & 0xFF];
		temp ^= T1[state >> 8 & 0xFF];
		temp ^= T2[state >> 16 & 0xFF];
		temp ^= T3[state >> 24 & 0xFF];
		temp ^= T4[state >> 32 & 0xFF];
		temp ^= T5[state >> 40 & 0xFF];
		temp ^= T6[state >> 48 & 0xFF];
		temp ^= T7[state >> 56 & 0xFF];

		return temp;
	}

	unsigned long long LED_80_64::Step(unsigned long long state, int step)
	{
		for (int i = 0; i < 4; i++)
		{
			state = AddConstants(state, (step * 4 + i));
			state = SubCellShiftRowAndMixColumns(state);
		}
		return state;
	}

	unsigned long long LED_80_64::EncryptOneBlock(unsigned long long state, unsigned long long sk0, unsigned long long sk1)
	{
		for (int i = 0; i < 12; i+=2)
		{
			state = AddKey(state, sk0);
			state = Step(state, i);
			state = AddKey(state, sk1);
			state = Step(state, i+1);
		}
		state = AddKey(state, sk0);
		return state;
	}

	unsigned char* LED_80_64::Encrypt(unsigned char input[], unsigned char key[], int len)
	{
		unsigned char *cipherText = new unsigned char[len];

		unsigned long long sk0 = byte2ulong(key, 0);
		unsigned char *sk2 = new unsigned char[8];
		for(int i=0;i<8;i++)
            sk2[i] = key[(8+i)%10];
		unsigned long long sk1 = byte2ulong(sk2, 0);

		for (int i = 0; i < len; i += 8)
		{
			unsigned long long state = byte2ulong(input, i);

			state = EncryptOneBlock(state, sk0, sk1);

			ulong2byte(state, cipherText, i);
		}

		return cipherText;
	}
